function.algorithm:
LOCAL
	result: BOOLEAN;
END_LOCAL;

IF ('AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.SIMPLE_GENERIC_EXPRESSION'
	IN TYPEOF (arg1)) 
THEN
	RETURN (TRUE);
END_IF;

IF arg1 IN arg2 
THEN 
	RETURN (FALSE);
END_IF;

IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.UNARY_GENERIC_EXPRESSION' 
	IN TYPEOF (arg1) 
THEN 
	RETURN 
	(Acyclic(arg1\Unary_generic_expression.operand,arg2+[arg1]));
END_IF;

IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.BINARY_GENERIC_EXPRESSION' 
	IN TYPEOF (arg1) 
THEN 
	RETURN 
	(Acyclic(arg1\Binary_generic_expression.operands[1],arg2+[arg1])
	AND
	Acyclic(arg1\Binary_generic_expression.operands[2],arg2+[arg1]));
END_IF;

IF 
'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.MULTIPLE_ARITY_GENERIC_EXPRESSION' 
	IN TYPEOF (arg1) 
THEN 
	result := TRUE;
	REPEAT i := 1 TO 
			SIZEOF (arg1\Multiple_arity_generic_expression.operands);
		result := result AND
		Acyclic(arg1\Multiple_arity_generic_expression.operands[i], arg2+[arg1]);
	END_REPEAT;

	RETURN (result);
END_IF;

LOCAL
	i: INTEGER;
END_LOCAL;

IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.INT_LITERAL' IN TYPEOF(arg) 
THEN 
	RETURN (TRUE); 
END_IF;
IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.REAL_LITERAL' IN TYPEOF(arg) 
THEN 
	RETURN (FALSE); 
END_IF;
IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.INT_NUMERIC_VARIABLE' IN TYPEOF(arg) 
THEN 
	RETURN (TRUE); 
END_IF;
IF 'AP242_MANAGED_MODEL_BASED_3D_ENGINEERING_ARM_LF.REAL_NUMERIC_VARIABLE' IN TYPEOF(arg) 
THEN 
